INSERT INTO `oc_comments` VALUES (1,0,0,0,'guests','system','{\"message\":\"conversation_created\",\"parameters\":[]}','system','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(4,0,0,0,'guests','changelog','## Welcome to Nextcloud Talk!\nIn this conversation you will be informed about new features available in Nextcloud Talk.','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(7,0,0,0,'guests','changelog','## New in Talk 6','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(10,0,0,0,'guests','changelog','- Microsoft Edge and Safari can now be used to participate in audio and video calls','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(13,0,0,0,'guests','changelog','- One-to-one conversations are now persistent and cannot be turned into group conversations by accident anymore. Also when one of the participants leaves the conversation, the conversation is not automatically deleted anymore. Only if both participants leave, the conversation is deleted from the server','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(16,0,0,0,'guests','changelog','- You can now notify all participants by posting \"@all\" into the chat','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(19,0,0,0,'guests','changelog','- With the \"arrow-up\" key you can repost your last message','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(22,0,0,0,'guests','changelog','- Talk can now have commands, send \"/help\" as a chat message to see if your administrator configured some','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(25,0,0,0,'guests','changelog','- With projects you can create quick links between conversations, files and other items','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(28,0,0,0,'guests','changelog','## New in Talk 7','comment','2024-12-10 09:00:53',NULL,'chat','1',NULL,NULL,NULL),(31,0,0,0,'guests','changelog','- You can now mention guests in the chat','